import * as React from 'react';
import { View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Button } from 'react-native-web';

function MealPlannerScreen({ navigation }) {
  return (
    <View style={{ width: 50, height: 50, flex: 1, flexDirection: 'column', justifyContent: 'center' , position: 'absolute', left: '30', top: '105', fontFamily: 'Poppins',
      fontStyle: 'normal', fontWeight: '600', fontSize: '16', lineLeight: '24' }}>
      <Text>Meal Nutritions</Text>
      <Button
        title="Go to Breakfast"
        onPress={() => navigation.navigate('Breakfast')}
      />    
    </View>
  );
}
function BreakfastScreen() {
  return (
    <View style={{ fontFamily: 'Poppins', fontStyle: 'normal',
    fontWeight: '600', fontSize: '16', lineHeight: '24' }}>
      <Text>Category</Text>
      <Button
        title="Go to Bluebarry Pancake"
        onPress={() => navigation.navigate('Breakfast')}
      /> 
    </View>
  );
}

const Stack = createNativeStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="MealPlanner">
        <Stack.Screen name="Meal Planner"
        component={MealPlannerScreen}
        options={{ 
          title: 'Meal Planner'
        }} />
        <Stack.Screen name="Breakfast" component={BreakfastScreen} />      
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
